import React from 'react';
import './HeroSection.css';
import MusicPlayer from './MusicPlayer'; // Import the MusicPlayer component

const HeroSection = () => {
  return (
    <div className="hero-section">
      <div className="background-overlay"></div>
      <div className="headline">Welcome to My Website</div>
      <div className="subheadline">Explore my portfolio and projects</div>
      <button className="cta-button">Get Started</button>

      {/* Render the MusicPlayer component */}
      <MusicPlayer
        audioUrl="./song.mp3"
        songTitle="heaven can wait"
        artist="organ tapes"
      />
    </div>
  );
};

export default HeroSection;
